INSERT INTO `pack_cards` VALUES ('a-fate-worse-than-death','fate-has-no-secrets',3,'98','Antonio José Manzanedo',NULL,'http://lcg-cdn.fantasyflightgames.com/l5r/L5C06_98.jpg','2018-08-03 23:00:47','2018-08-03 23:00:47'),('a-legion-of-one','meditations-on-the-ephemeral',3,'116','Borja Pindado',NULL,'http://lcg-cdn.fantasyflightgames.com/l5r/L5C07_116.jpg','2018-08-03 23:00:47','2018-08-03 23:00:47'),('abandoning-honor','the-fires-within',3,'41','Lin Hsiang','','http://lcg-cdn.fantasyflightgames.com/l5r/L5C11_41.jpg','2018-08-03 23:00:47','2018-08-03 23:00:47'),('above-question','core',1,'141','Stu Barnes','\"Excuse me, samurai-san, but you must be mistaken! It could not possibly have been her.\"','http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_141.jpg','2018-08-03 23:00:47','2018-08-03 23:00:47'),('adept-of-shadows','core',1,'180','Felipe Gaona','There are dozens of ways to hide, and only one way to be seen.','http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_180.jpg','2018-08-03 23:00:47','2018-08-03 23:00:47'),('adept-of-the-waves','core',1,'84','Jason Engle','\"Water is flexible and yielding, yet none can withstand the crashing waves.\"','http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_84.jpg','2018-08-03 23:00:47','2018-08-03 23:00:47'),('admit-defeat','core',1,'147','David Horne','It is not only a question of defeating one\'s opponents, but defeating them in such a manner that they know they have been beaten.','http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_147.jpg','2018-08-03 23:00:47','2018-08-03 23:00:47'),('adopted-kin','tainted-lands',3,'33','Joyce Maureira','Facing a crisis of children, the Dragon were willing to turn even to the peasantry to find new heirs.','http://lcg-cdn.fantasyflightgames.com/l5r/L5C10_33.jpg','2018-08-03 23:00:47','2018-08-03 23:00:47'),('against-the-waves','core',1,'177','Calvin Chua','Water is ever changing. A gentle wave one moment and a torrent of force the next.','http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_177.jpg','2018-08-03 23:00:47','2018-08-03 23:00:47'),('agasha-shunsen','elements-unbound',3,'106','Felipe Gaona','','http://lcg-cdn.fantasyflightgames.com/l5r/L5C14_106.jpg','2018-08-03 23:00:47','2018-08-03 23:00:47'),('agasha-sumiko','the-chrysanthemum-throne',3,'65','Lin Hsiang','\"I will not merely record history. I will forge it myself.\"','http://lcg-cdn.fantasyflightgames.com/l5r/L5C05_65.jpg','2018-08-03 23:00:47','2018-08-03 23:00:47'),('agasha-swordsmith','core',1,'56','Stanislav Dikolenko',NULL,'http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_56.jpg','2018-08-03 23:00:47','2018-08-03 23:00:47'),('ageless-crone','into-the-forbidden-city',3,'53','Lin Hsiang','\"It is good to see you again, Grandmother. You have not aged a day. Ever.\" – Ikoma Ikehata','http://lcg-cdn.fantasyflightgames.com/l5r/L5C04_53.jpg','2018-08-03 23:00:47','2018-08-03 23:00:47'),('aggressive-moto','core',1,'111','Polar Engine','Moto can die but cannot yield.','http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_111.jpg','2018-08-03 23:00:47','2018-08-03 23:00:47'),('akodo-gunso','core',1,'71','Polar Engine',NULL,'http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_71.jpg','2018-08-03 23:00:47','2018-08-03 23:00:47'),('akodo-kage','underhand-of-the-emperor',3,'14','','\"Thank you, sensei. Your wisdom has again guided me to the right path.\" - Akodo Toturi',NULL,'2018-08-03 23:00:47','2018-08-03 23:00:47'),('akodo-toshiro','the-chrysanthemum-throne',3,'67','Stanislav Dikolenko','\"You are the most gifted swordsman of your generation. Why must you waste your time on this cowardly art?\" Akodo Gendo','http://lcg-cdn.fantasyflightgames.com/l5r/L5C05_67.jpg','2018-08-03 23:00:47','2018-08-03 23:00:47'),('akodo-toturi','battle-for-the-stronghold-kit',1,'8','','',NULL,'2018-08-03 23:00:47','2018-08-03 23:00:47'),('akodo-toturi','core',1,'79','Shawn Ignatius Tan','A lion is more than his roar, his mane, his teeth, his heart. A lion is all of these.','http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_79.jpg','2018-08-0